import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './nav.css';

function Nav(props) {
  const linkList = props.value;
  const allLinks = linkList.map((link) =>
    <p> {link.title} </p>
  );

  return (
    <div class="navbar">
        <ul class="nav">
          {allLinks}
        </ul>
      </div>
  );
}

export default Nav;
